import { useState } from "react";
import "./Zone.scss";
import marker from "./img/marker.png";

const Zone = (props) => {
    return <ul className="zone block">
        <li>
            <div className="name"><p className="name">Культура</p></div>
            <select>
                <option value="wheat">Пшеница</option>
                <option value="beet">Сахарная свекла</option>
                <option value="Sunflower">Подсолнечник</option>
            </select>
        </li>
        <li>
            <div className="name">
                <p className="name">Место старта</p>
                <button className="marker_set"><img src={marker} alt="marker"/></button>
            </div>
            <div className="coords">
                <div className="coord">
                    <div className="coord_item"><p>X</p></div>
                    <input type="number"
                        min={0}
                        max={90}
                        step={0.000001}
                    />
                </div>
                <div className="coord">
                    <div className="coord_item"><p>Y</p></div>
                    <input type="number"
                        min={0}
                        max={90}
                        step={0.000001}
                    />
                </div>
            </div>
            <button className="set">Установить</button>
        </li>
        <li className="flex">
            <div className="left_name norm"><p>Поворот</p></div>
            <input type="range"
                min={0}
                max={360}
                step={1}
            />
            <input type="number"
                min={0}
                max={360}
                step={1}
            />
        </li>
        <li className="flex">
            <div className="left_name"><p>Расстояние между линиями</p></div>
            <input type="range"
                min={0}
                max={360}
                step={1}
            />
            <input type="number"
                min={0}
                max={360}
                step={1}
            />
        </li>
    </ul>
}
export default Zone
